import React, { useState } from 'react';
import Modal from 'react-modal';

Modal.setAppElement('#root');

function PaymentModal({ isOpen, onRequestClose, onPaymentSubmit, amount, ID }) {
  const [paymentRising, setPaymentRising] = useState('');
  const [cardId, setCardId] = useState('');
  const [orderId, setOrderId] = useState('');
  setPaymentRising(amount);
  const handleSubmit = (e) => {
    e.preventDefault();
    onPaymentSubmit(orderId, paymentRising, cardId);
  };

  return (
    <Modal isOpen={isOpen} onRequestClose={onRequestClose} contentLabel="Custom Modal">
      <h2>Add Payment</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Payment Rising:</label>
          <p>{paymentRising}</p>
        </div>
        <div>
          <label>Card ID:</label>
          <input type="text" value={cardId} onChange={(e) => setCardId(e.target.value)} />
        </div>
        <button type="submit">Submit Payment</button>
      </form>
    </Modal>
  );
}

export default PaymentModal;
